import { FiSearch } from 'react-icons/fi'

function App() {
  return (
    <div className="container">
      <h1 className="titulo">Buscador de CEP</h1>
      <div className="containerInput">
          <input type="text" placeholder="Digite seu CEP..."/>
      </div> 
      <button className="buttonSearch">
           <FiSearch/>
      </button>
    </div>
  );
}

export default App;
